import React from "react";
import Navbar from "../resources/components/Navbar";
import WorkOutlineIcon from "@mui/icons-material/WorkOutline";

const Jobs = () => {
  return (
    <>
      <Navbar />
      <div className="page-title">
        Jobs <WorkOutlineIcon />
      </div>
    </>
  );
};

export default Jobs;
